export default function UserDynamiqueTab(props) {

    return (

        <tr key={props.key}>
            {console.log("bonjour")}
            <td>{props.year}</td>
            <td>{props.savingsEndOfYear}</td>
            <td>{props.yearlyInterest}</td>
            <td>{props.totalInterest}</td>
            <td>{props.yearlyContributionT}</td>
        </tr>
    )
}
